import React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";

const ContactList = (props) => {
  const contactlist = [ 
    {
      name: "Dexter",
      email: "dextersigue@gmail.com",
      message: "Hello World",
    },
  
  ];
  //  const contaclist = contactlist.map((item, index)=>{
  //       return (<tr key={index}>
  //              <td>
  //                 {item.name}
  //              </td>
  //              <td>
  //                 {item.email}
  //              </td>
  //              <td>
  //                 {item.message}
  //              </td>
  //              </tr>)
  //         })
  return (
    <div>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell align="center">Name</TableCell>
              <TableCell align="center">Email</TableCell>
              <TableCell align="center">Message</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {props.contactlist.map((contactdetail) => (
              <TableRow  
                key={contactdetail.id}
                sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
              >
                <TableCell align="center">{contactdetail.fname}</TableCell>
                <TableCell align="center">{contactdetail.lname}</TableCell>
                <TableCell align="center">{contactdetail.emailAd}</TableCell>
                <TableCell align="center">{contactdetail.msg}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default ContactList;
